    fetch(`api/reports/${data}`).then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])
  return (
    <div>
      {(typeof data.article === 'undefined') ? (
        <p>Loading...</p>
      ) : (
        data.article.map
      )}
    </div>
  )
}

export default App
